class RoseBud extends HTMLElement {
  static get observedAttributes() {
    return ['width'];
  }
  constructor() {
    super();
    this.innerHTML = svgBud;
    const icon = document.getElementById('svgBud');
    icon.style.color = 'light-dark(#EC1F27, white)';
  }
  get width() {
    return this.hasAttribute && this.getAttribute('width');
  }
  set width(val) {
    if (val) {
      this.setAttribute('width', val)
    } else {
      this.removeAttribute('width');
    }
  }
  attributeChangedCallback(name, oldValue, newValue) {
    const icon = document.getElementById('svgBud');
    if (name === 'width') {
      if (newValue !== oldValue) {
        icon.style.width =
          newValue.includes('px') ? newValue : `${newValue}px`;
      }
    }
  }
}


// Finally lets define this custom element
customElements.define('rose-bud', RoseBud);


document.getElementById("start-button").addEventListener("click", () => {
  const resultElement = document.getElementById("result");

  if (!window.EyeDropper) {
    resultElement.textContent =
      "Your browser does not support the EyeDropper API";
    return;
  }

  const eyeDropper = new EyeDropper();

  eyeDropper
    .open()
    .then((result) => {
      resultElement.textContent = result.sRGBHex;
      resultElement.style.backgroundColor = result.sRGBHex;
      document.getElementById('svgBud').style.color = result.sRGBHex;
    })
    .catch((e) => {
      resultElement.textContent = e;
    });
});